const About = () => {
  return (
    <div className="contact">
      <h1>Contact me!</h1>

      <h4>Phone</h4>
      <p>9650097129</p>

      <h4>Email</h4>
      <p>prakhargoel019@grmail.com</p>

    </div>
  );
};

export default About;
